import React, { useEffect, useState } from 'react';
import axios from 'axios';

constApp = () => {
  const [hitters, setHitters] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/players/')
      .then(response => {
        setHitters(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the player data!", error);
      });
  }, []);

  return (
    <div className="App"><h1>Baseball Hitter Statistics</h1><table><thead><tr><th>Name</th><th>Team</th><th>Position</th><th>Games Played</th><th>Batting Average</th><th>Home Runs</th><th>Singles</th><th>Doubles</th><th>Triples</th><th>Strikeouts</th><th>Walks</th></tr></thead><tbody>
          {hitters.map((hitter, index) => (
            <tr key={index}><td>{hitter.name}</td><td>{hitter.team}</td><td>{hitter.position}</td><td>{hitter.games_played}</td><td>{hitter.batting_average}</td><td>{hitter.home_runs}</td><td>{hitter.singles}</td><td>{hitter.doubles}</td><td>{hitter.triples}</td><td>{hitter.strikeouts}</td><td>{hitter.walks}</td></tr>
          ))}
        </tbody></table></div>
  );
}

exportdefaultApp;
